import React, { useState } from 'react';
import Rate from '../Rate Component/Rate';


function MovieCard(props) {
  return (
    <div className="col mb-2">
      <div className="card bg-dark w-100 h-100">
        <img src={props.movie.posterUrl} className="card-img-top" alt="..." />
        <div className="card-body" style={{ height: '70px' }}>
          <h5
            className="card-title text-wrap text-center mt-1"
            style={{ fontSize: '17px' }}
          >
            {props.movie.title}
          </h5>
        </div>
        <div
          className="card-footer d-flex justify-content-between align"
          style={{ height: '60px' }}
        >
          <small className="text-muted">
            <Rate />
          </small>
          <button type="button" class="btn btn-outline-secondary text-wrap"><span class="badge badge-light">9</span> / 10</button>
          {/* <small class="badge badge-light rounded-circle" style={{width:"30px",height:"30px"}}>4/10</small> */}
        </div>
      </div>
    </div>
  );
}
export default MovieCard;
